import React, { useContext } from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { AuthContext } from '../context/AuthContext'; // Import AuthContext
import { Link } from 'react-router-dom';

const Homepage = () => {
  const { user, logoutUser } = useContext(AuthContext); // Access logoutUser function from AuthContext

  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">Home</Navbar.Brand>
        <Nav className="me-auto  nav_bar_warpper">
          <Nav.Link href="/about">About</Nav.Link>
          <Nav.Link href="/services">Services</Nav.Link>
          <Nav.Link href="/contact">Contact</Nav.Link>
          {user ? (
            <>
              <p onClick={logoutUser}>Logout</p>
              {user.isAdmin && <Link to='/signup'>SignUp</Link>} {/* Render SignUp link only if the user is an admin */}
            </>
          ) : (
            <>
              <Link to='/login'>Login</Link>
            </>
          )}
        </Nav>
      </Navbar>
      {user && <p> Hello {user.username}</p>}
    </div>
  );
}

export default Homepage;
